[Config ring_csqf]
network = combinedshapers.simulations.ring.ring
#abstract-config = true (requires omnet 6)
description = ""

# Set the simulation time
sim-time-limit = 100s
repeat = 10

# disable automatic MAC forwarding table configuration
*.macForwardingTableConfigurator.typename = ""

# disable local multicast loop
**.udp.defaultMulticastLoop = false

*.*.eth[*].bitrate = 1Gbps

##########################
# Visualizer Configuration
# enable multiple canvas visualizers
*.visualizer.typename = "IntegratedMultiCanvasVisualizer"

#################################

#*.node*.app[*].tagger.typename = "PacketTagger" # enable VLAN Tagging

#############################
# Stream Coding Configuration
*.*.hasOutgoingStreams = true
*.*.hasIncomingStreams = true

## disable forwarding IEEE 802.1Q C-Tag
#*.sw*.bridging.directionReverser.reverser.excludeEncapsulationProtocols = ["ieee8021qctag"]

###############################
# Traffic Shaping Configuration
*.sw*.hasEgressTrafficShaping = true

*.sw*.eth[*].macLayer.queue.numTrafficClasses = 2
*.sw*.eth[*].macLayer.queue.*[0].display-name = "TT"
*.sw*.eth[*].macLayer.queue.*[1].display-name = "TT"
*.sw*.eth[*].macLayer.queue.*[2].display-name = "TT"
*.sw*.eth[*].macLayer.queue.*[3].display-name = "BE"

*.*.eth[*].macLayer.queue.transmissionGate[0].enableImplicitGuardBand = false   # activate implicit guard band for Scheduled Traffic
*.*.eth[*].macLayer.queue.transmissionGate[0].gbMode = "bestCase" # "worstCase" "bestCase"
*.*.eth[*].macLayer.queue.transmissionGate[1].enableImplicitGuardBand = false   # activate implicit guard band for Scheduled Traffic
*.*.eth[*].macLayer.queue.transmissionGate[1].gbMode = "bestCase" # "worstCase" "bestCase"
*.*.eth[*].macLayer.queue.transmissionGate[2].enableImplicitGuardBand = false   # activate implicit guard band for Scheduled Traffic
*.*.eth[*].macLayer.queue.transmissionGate[2].gbMode = "bestCase" # "worstCase" "bestCase"
*.*.eth[*].macLayer.queue.transmissionGate[3].enableImplicitGuardBand = true        # activate implicit guard band for AVB Traffic
*.*.eth[*].macLayer.queue.transmissionGate[3].gbMode = "worstCase"         # "worstCase" "bestCase"

*.sw*.eth[*].macLayer.queue.typename = "Ieee8021qCycleSpecificQueueingAndForwarding"
*.sw*.eth[*].macLayer.queue.queue[*].packetCapacity = -1
*.sw*.eth[*].macLayer.queue.queue[*].dataCapacity = -1b # 1500*8b
*.sw*.eth[*].macLayer.queue.transmissionGate[0].durations = [50us, 100us]
*.sw*.eth[*].macLayer.queue.transmissionGate[0].offset = 0us
*.sw*.eth[*].macLayer.queue.transmissionGate[1].durations = [50us, 100us]
*.sw*.eth[*].macLayer.queue.transmissionGate[1].offset = 100us
*.sw*.eth[*].macLayer.queue.transmissionGate[2].durations = [50us, 100us]
*.sw*.eth[*].macLayer.queue.transmissionGate[2].offset = 50us
*.sw*.eth[*].macLayer.queue.transmissionGate[3].alwaysOpen = true

